import React from "react";
import {
  AboutContainer,
  AboutBg,
  AboutContent,
  AboutH1,
  AboutP,
  AboutIconRow,
  AboutIcon,
  AboutFrost,
} from "./AboutElms";
import Css from "../../images/css.png";
import HTML from "../../images/html-5.png";

const About = () => {
  return (
    <AboutContainer id="about">
      <AboutBg>
        <AboutContent>
          <AboutH1>About Me</AboutH1>
          <AboutIconRow>
            <AboutIcon src={Css} type="image/png" />
            <AboutIcon src={HTML} type="image/png" />
            <AboutIcon />
          </AboutIconRow>
          <AboutIconRow>
            <AboutIcon />
            <AboutIcon />
            <AboutIcon />
          </AboutIconRow>
        </AboutContent>
        <AboutFrost />
      </AboutBg>
    </AboutContainer>
  );
};

export default About;
